column2:
{u'review': u'iPhone6 IOS8.3です。
 ラインの通知は出てくるにですが、内容が読めない状態が最近続いています。読み込みも不定期に遅くなり非常に不便です。送信にも遅れがあります。
 アップデートを待っています。お願いします。', u'id': u'443904275', u'name': {u'label': u'LINE'}}

{u'review': u'なんで動画送れないの？
こちゃに送ろうとすると強制終了。苛々する。
こんなんだったら動画送信する機能なくしたらどうですか。早く改善してください。', u'id': u'443904275', u'name': {u'label': u'LINE'}}

{u'review': u'いくら履歴消しても画像処理は軽くならないし、コメント送る時とか画像開いた時に数分フリーズする

その他の通知はいらないです。わざわざ表示する必要ないです

嫌がらせですか？', u'id': u'443904275', u'name': {u'label': u'LINE'}}

{u'review': u'タイムラインは残ってるのに、
友達が全部消えた。

すごく困るからはやく直して欲しい。', u'id': u'443904275', u'name': {u'label': u'LINE'}}

{u'review': u'インターネットの接続の確認しろってでて使えない。
LINEだけが使えないのはなぜですか？
メッセージ送れない受信できないTL見れない。スタンプも買ったりしてるのに意味なくなったら責任取ってくれるんですか？', u'id': u'443904275', u'name': {u'label': u'LINE'}}

{u'review': u'結構使いやすい〜！
でも、最近バクる⤵︎
直してー！', u'id': u'443904275', u'name': {u'label': u'LINE'}}

{u'review': u'モンスターズインクの
着せ替えだしてください‼︎
お願いします‼︎', u'id': u'443904275', u'name': {u'label': u'LINE'}}

{u'review': u'ひとことの部分がバグって前に書いたやつが消えません。
というよりは、表示もされなくなってしまいました。
直してください。', u'id': u'443904275', u'name': {u'label': u'LINE'}}

{u'review': u'モンハンみたいです(ㆁ௰ㆁ)
良ければ招待コード使ってください！
140243813です♪', u'id': u'952608759', u'name': {u'label': u'モンスターギア'}}

{u'review': u'コメントを投稿したいです。しかしできません。コメント作成を押すと、
「YouTubeチャンネルの作成、この操作を行うにはYouTubeチャンネルが必要です。今すぐ作成しますか？」という表示が出て、okを押しても再び同じ表示が出てきて無限ループになってしまいます。
コメント投稿が出来ないならいさぎよく「ご利用の端末からはこの操作はできません。」と表示してください。', u'id': u'544007664', u'name': {u'label': u'YouTube'}}

{u'review': u'アップデートしてもあまり変わらないような気がする。
しかも20分ほどの動画で有料会員になれと言わんばかりの量のCMを挟み込んでくる。
どんどん落ちぶれていってますね、まだdailymotionの方が使える。', u'id': u'544007664', u'name': {u'label': u'YouTube'}}

{u'review': u'履歴も見れるし画面の縮小もできるし
映像も特に問題ないし、至って普通のアプリじゃん
なんでこんなネガキャンされてんの？', u'id': u'544007664', u'name': {u'label': u'YouTube'}}

{u'review': u'なんか映像が映し出されない
音は、出てるのに。
どういうこと？', u'id': u'544007664', u'name': {u'label': u'YouTube'}}

{u'review': u'17＋になったから消えた
みれんごつなった
お願いだから、戻してください！🙏', u'id': u'544007664', u'name': {u'label': u'YouTube'}}

{u'review': u'公式のアプリなのに音と映像がズレて話にならない

 PS4とかの外部機器に接続して使うリモコンとして見たら文句ないけど…

速く修正してくれ', u'id': u'544007664', u'name': {u'label': u'YouTube'}}

