{u'review': u'見やすいしバックグラウンド再生もあって便利
広告も出なくてオススメ
けどきちんと設定してあるはずのリピート再生がされない', u'id': u'959454698', u'name': {u'label': u'無料で聴ける音楽アプリ！SoundMusic（サウンドミュージック） for Youtube'}}

{u'review': u'アプリを開けて10秒ほど経つと、画面が固まって動かなくなります。
投稿が全く見れません。
早く直してくださいお願いします（ ;  ; ）', u'id': u'389801252', u'name': {u'label': u'Instagram'}}

{u'review': u'愛用してます^ ^
みんなの様子が見れるし
アップも簡単だから楽しいです。', u'id': u'389801252', u'name': {u'label': u'Instagram'}}

{u'review': u'タイムライン見るたび
すぐ固まります！
早く直して下さい‼︎', u'id': u'389801252', u'name': {u'label': u'Instagram'}}

{u'review': u'また開けなくなった。
アンストしてインストール
したら今度はログイン出来なくなった。意味不明。みんな困ってるのにまだ直さないんですか？？', u'id': u'389801252', u'name': {u'label': u'Instagram'}}

{u'review': u'簡単だし、きれいに写真が撮れます。
撮った写真を人に見せたい時も便利です。
FBはやってないけど、これはやってます^ ^', u'id': u'389801252', u'name': {u'label': u'Instagram'}}

{u'review': u'バグ修正しているんでしょうか。ここを見る限り何も改善されていないのは一目瞭然だと思うのですが。
これではバグ修正という名目でレビュー消しをしているだけだと疑われるのも当然です。
改善する気がないのならアプデで徒に期待させるのをやめてくださいマジで迷惑。', u'id': u'333903271', u'name': {u'label': u'Twitter'}}

{u'review': u'バグおおすぎ。
通知きてないのに、アイコンの所に①とかでてくる。大迷惑。
いらない広告とか邪魔。', u'id': u'333903271', u'name': {u'label': u'Twitter'}}

{u'review': u'無料で使わせて頂いてるので文句は言えませんが、
できることなら画像欄を元のコラージュ風のものに戻してほしいです…
ご検討ください！', u'id': u'333903271', u'name': {u'label': u'Twitter'}}

{u'review': u'ダイレクトメール（DM）で、メッセがきてるので返したいのに書いても送信できません。
時間を置いても同じ
いい加減しっかりとしたアプリに戻してください', u'id': u'333903271', u'name': {u'label': u'Twitter'}}

{u'review': u'ずっとエラーになって始められません。
やっと親の許可がとれて始められると思ったのに残念です。
電話番号がない人のことも考えてください。', u'id': u'333903271', u'name': {u'label': u'Twitter'}}

{u'review': u'アプデして、バグ修正したら新たなバグが増えるってなんなんだよ…

ずっと通知が、嫌がらせのように一件つく

絶対に消えません', u'id': u'333903271', u'name': {u'label': u'Twitter'}}

{u'review': u'意見、要望、不具合報告はスルーして変な機能ばかりつけて空回りしてるアプリ。
一番いらないのは、広告収入源になってるのか知らないけど、プロモーションという名の強制ツイート。目障りだから毎度スパブロしてたけど、もう流石にストレスなのでアプリ乗り換える事にしました。
ジャネッタとか他のアプリのほうがいいですよ！', u'id': u'333903271', u'name': {u'label': u'Twitter'}}

{u'review': u'ホーム画面でスライドしたら見れたトレンドやアクティビティが全く見れなくなった。
あと、サブ垢などで見るとアップデート前の状態のままだったりと中途半端。
とにかくトレンドとアクティビティが見れないのは不便なのでなんとかしてほしい。', u'id': u'333903271', u'name': {u'label': u'Twitter'}}

{u'review': u'診断なっても、評価すら出てこない。
つまんないから、消してください。
☆を付けたくない。', u'id': u'739787904', u'name': {u'label': u'美男美女診断'}}

{u'review': u'今時ライブラリからのアクセスして診断出来ないとかクソすぎ
いつの時代のアプリだよ
ライブラリからできた方が絶対楽しめる', u'id': u'739787904', u'name': {u'label': u'美男美女診断'}}

{u'review': u'友達とお遊びでやるアプリですね。顔のパーツの大小ではなく位置関係で採点がかなり変わってくるみたいです。
自分の顔で試してみて真顔では伊藤英明になったり、笑顔ではジミー大西、イジリー岡田にだったり´д` ;
笑顔のまま伊藤英明に近づくにはどうすればいいのか試行錯誤したりなんかして笑 そこそこ遊べました^_^', u'id': u'739787904', u'name': {u'label': u'美男美女診断'}}

{u'review': u'俺イケメンって言われるよ？
 多分これは比率であってパーツは評価しないからダメなのかもしれない。
常にB', u'id': u'739787904', u'name': {u'label': u'美男美女診断'}}

{u'review': u'このアプリ、
適当に言いすぎ！
当たってないし…。', u'id': u'739787904', u'name': {u'label': u'美男美女診断'}}

{u'review': u'もっと使いやすいとイイかも
テキストメッセージの設定の項目に国別があるが日本は何故ないのか
設定の仕方が分からない', u'id': u'284882215', u'name': {u'label': u'Facebook'}}

{u'review': u'なぜユーザーレビューを消すのに躍起になるの？？ ユーザー意見に耳も傾けず、評価を上げるサクラまで用意して。

チャットが自動的にアクティベートされる問題、1年以上指摘してるのに直してくれません。
「安心のプライバシー」なんて嘘八百の文句は、全くのまやかしです。公式アプリ自ら、ユーザー設定を強制的に変え、ユーザーのプライバシーを文字通り「侵害」している、卑劣なアプリです。', u'id': u'284882215', u'name': {u'label': u'Facebook'}}

{u'review': u'updateするたびに最悪になります。
何とかしてほしい。
段々と使えない感じになってきていて、がっかりです。', u'id': u'284882215', u'name': {u'label': u'Facebook'}}

{u'review': u'絶対ダウンロードしない方がいい
100pしか読めない
あとは課金とかふざけてる', u'id': u'919478091', u'name': {u'label': u'【500作全巻無料】 ハートコミックス'}}

{u'review': u'初めて使ったけど
わかりやすくて
めっちゃ便利ー!!', u'id': u'667861049', u'name': {u'label': u'フリマアプリ-メルカリ フリマでかんたんショッピング'}}

{u'review': u'招待コードです！
MCKXDJ

ぜひお願いします！', u'id': u'667861049', u'name': {u'label': u'フリマアプリ-メルカリ フリマでかんたんショッピング'}}

{u'review': u'広告がウザすぎて集中して読めない(´ω`；)
このレビュー桜が書き込んでるん？
漫画の数少ないよ〜。', u'id': u'985072363', u'name': {u'label': u'【ぜんぶ無料！】マンガ姫 - きゅんっとする人気恋愛少女コミック、小説掲載！'}}

{u'review': u'使っていたアプリなのに…
アプデしたら、開かなくなった（ ;  ; ）ひどいー（ ;  ; ）
早く治してください(＞人＜;)', u'id': u'284815942', u'name': {u'label': u'Google'}}

{u'review': u'アプリのリンクはどこに消えたんでしょう？
これまでメールにカレンダーにと一つのアプリで便利に使ってきたのに。
これではまるでただのブラウザ。', u'id': u'284815942', u'name': {u'label': u'Google'}}

{u'review': u'ページは開けることは出来るけど、検索出来なくなりました。
すごく便利で重宝してたのに…
早急な対応をよろしくお願いします！', u'id': u'284815942', u'name': {u'label': u'Google'}}

{u'review': u'アップデートしたかGoogleが消えたんだけど…
直してもらえますか？
お願いします。', u'id': u'284815942', u'name': {u'label': u'Google'}}

{u'review': u'まったく読み込めません。
どうして、、
改善の方法ありますか？', u'id': u'454638411', u'name': {u'label': u'Messenger'}}

{u'review': u'フェイスブックと連動していて、オープンではない形で、お話しが出来て、設定次第では、無料通話もできるし、写真やビデオ、また、カスタマイズも、
すっごく、楽しく、使わせていただいています。
ありがとうございます。', u'id': u'454638411', u'name': {u'label': u'Messenger'}}

{u'review': u'向きを変えても縦がいいです。
横になると文字が打ちにくい…
入力中が分かるのは嬉しいです！', u'id': u'454638411', u'name': {u'label': u'Messenger'}}

{u'review': u'ボス強すぎなんだけど
30回やっても勝てないんだけど
ふざけんなよ！！💢', u'id': u'658511662', u'name': {u'label': u'モンスターストライク'}}

{u'review': u'シンプルで遊びやすいです(^^) 
良かったらコード使って下さい。
001988948', u'id': u'658511662', u'name': {u'label': u'モンスターストライク'}}

{u'review': u'はい、モンクソデスネ
最初は面白いと思ってもその内
このゲームのつまらなさに気づくはず', u'id': u'658511662', u'name': {u'label': u'モンスターストライク'}}

{u'review': u'運営が能無し。
かなり頑張ったけど飽きた。
マンネリ、課金前提', u'id': u'931894765', u'name': {u'label': u'NBA CLUTCH TIME【本格3Dバスケットボールゲームは『NBA公式』のクラッチタイム！】'}}

{u'review': u'とてもおもしろい！
ガチャの確率すこーし上げてくれてもいいかな！笑
それにしても面白いしとてもはまってます！', u'id': u'931894765', u'name': {u'label': u'NBA CLUTCH TIME【本格3Dバスケットボールゲームは『NBA公式』のクラッチタイム！】'}}

{u'review': u'ガチャガチャうるさい！

ランキングイベ常習＝上位以外これからずっと養分。

今時ランキングイベント常習は無いんでない？', u'id': u'931894765', u'name': {u'label': u'NBA CLUTCH TIME【本格3Dバスケットボールゲームは『NBA公式』のクラッチタイム！】'}}

{u'review': u'前よりは楽しくなった。
選手も手に入りやすくはなってる。
課金者には勝てないけど、無課金でも星4チャンピオンシップは楽しめた。', u'id': u'931894765', u'name': {u'label': u'NBA CLUTCH TIME【本格3Dバスケットボールゲームは『NBA公式』のクラッチタイム！】'}}

{u'review': u'チーム総合力は余裕で上回っているのに50点差の惨敗とか。。。
結局課金してレア度高いやつ集めろってことか。
星4とか育てても意味ない。', u'id': u'931894765', u'name': {u'label': u'NBA CLUTCH TIME【本格3Dバスケットボールゲームは『NBA公式』のクラッチタイム！】'}}

{u'review': u'始めは面白いです。
あとは課金ゲーです。

NBAもよくこの内容で黙ってるな', u'id': u'931894765', u'name': {u'label': u'NBA CLUTCH TIME【本格3Dバスケットボールゲームは『NBA公式』のクラッチタイム！】'}}

{u'review': u'チャンピオンシップになると勝てない。
総合力が相手を上回っているのにダブルスコアで負けるって何なの。
それ以外は特に不満はない。', u'id': u'931894765', u'name': {u'label': u'NBA CLUTCH TIME【本格3Dバスケットボールゲームは『NBA公式』のクラッチタイム！】'}}

